Diagnosis. Recognized by the dark brown to fusco-testaceous general coloration with pale and black areas (
Fig. 12
), head with Y-shaped black spot on frons; endosoma with C-shaped distal sclerite (
Fig. 47
); posterior wall of female genitalia with triangular interramal lobes with short projection on lateroapical margin (
Fig. 102
).

Redescription. Male: COLORATION : Dark brown to fusco-testaceous. Head: Brown, with Y-shaped black marking extending from longitudinal sulcus to frons, two black patches around antenna and two lateral black spots in neck; eye, mandibular plate, maxillary plate and apex of buccula brown; labium brown with black apex; clypeus uniformly colored (brown); antennal segments brown to black with segment I pale brown. Thorax: Pronotum brown; calli and lateral margins dark brown; inner region of calli pale brown; two rounded black spots on humeral angles; collar pale; longitudinal line on pronotum (sometimes absent) pale; proepisternum black with a yellowish line in margin; scutellum black or brown, with pale longitudinal line. Hemelytra brown; clavus, corium (internal region), and hemelytral membrane brown; embolium and external region of cuneus pale; internal margin of cuneus black; ostiolar peritreme with pale brown margins; abdomen yellowish with a black spot at apex of pygophore. VESTITURE AND STRUCTURE: Head: Antenna with short erect pilosity, antennal segment I 1.2 times width of head (Table 1 ), two times width of II; segment
II 3
times longer than segment I (Table 1 ). Thorax: Pronotum with anterior lobe abruptly narrowed with golden sparse and erect pilosity. MEASUREMENTS : Table 1 . GENITALIA: Pygophore: Elongated, apex slightly rounded (
Fig. 22
). Parameres: Left paramere sickle-shape, dorsal margin of basal sensory lobe almost straight and ventral margin clearly convex, right paramere straight (
Fig. 34
). Endosoma: ribbon like sclerite with an expanded lobe that reaches further secondary gonopore covered with microtrichia (
Fig. 47
), distal sclerite C-shaped with thick spines (
Fig. 47
).

Female: Similar to male in color, but slightly longer. MEASUREMENTS : Table 1 . GENITALIA: First gonapophysis: With broad apical grooved region (
Fig. 68
). Second gonapophysis: As in
Fig. 78
. Dorsal labiate plate with small sclerite caudal to sclerotized rings (
Fig. 90
). Posterior wall with triangular interramal lobes with a short projection in lateroapical margin (
Fig. 102
). Dorsal structure covering half of interramal lobes and medial process shaped as an inverted Y (
Fig. 102
).

